uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User Parameters
uniform float u_speed;
uniform float u_fov;
uniform float u_camera_dist;
uniform float u_morph;

out vec4 fragColor;

/**
 * Procedural Surrealism: "The Whispering Monoliths"
 * A sequence of shifting, impossible geometries floating in a volumetric void.
 * Uses raymarching, fractal folding, and rhythmic color cycles.
 */

// Math Constants
#define PI 3.14159265359
#define MAX_STEPS 100
#define SURF_DIST 0.001
#define MAX_DIST 100.0

// Rotation matrix
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Smooth Minimum (Polynominal)
float smin(float a, float b, float k) {
    float h = clamp(0.5 + 0.5 * (b - a) / k, 0.0, 1.0);
    return mix(b, a, h) - k * h * (1.0 - h);
}

// Path for the camera and geometry to follow
vec2 getPath(float z) {
    return vec2(sin(z * 0.15), cos(z * 0.1)) * 3.5;
}

// Fractal Fold
void fractalFold(inout vec3 p) {
    for(int i = 0; i < 3; i++) {
        p.xy = abs(p.xy) - 0.5;
        p.xy *= rot(0.5 + iTime * 0.1);
        p.yz = abs(p.yz) - 0.2;
        p.yz *= rot(-0.3);
    }
}

// Scene SDF
float map(vec3 p) {
    vec2 path = getPath(p.z);
    p.xy -= path; // Universe centering

    vec3 p1 = p;
    // Spiral twist
    p1.xy *= rot(p.z * 0.2 + iTime * 0.2);

    // The "Central Structure" - A floating surreal ribbon/tower
    fractalFold(p1);

    // Create repeating structures along Z
    float z_cycle = mod(p1.z, 4.0) - 2.0;
    vec3 p_box = vec3(p1.x, p1.y, z_cycle);

    // Box shape
    vec3 d = abs(p_box) - vec3(0.4, 0.8, 0.2);
    float box = length(max(d, 0.0)) + min(max(d.x, max(d.y, d.z)), 0.0);

    // Spheres morphing
    float sphere = length(p_box) - (0.6 + 0.2 * sin(iTime + p.z));

    float d1 = mix(box, sphere, 0.5 + 0.5 * sin(iTime * 0.5 + p.z * 0.1));

    // Background "clouds" or pillars
    float pillars = length(mod(p.xy + 10.0, 20.0) - 10.0) - 1.5;

    return smin(d1, pillars, 1.5);
}

// Normal Calculation
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.001, 0.0);
    vec3 n = vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    );
    return normalize(n);
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float t = iTime * u_speed;

    // --- Parallel Rail Camera Logic ---
    vec3 pathPos = vec3(0.0, 0.0, t);
    pathPos.xy += getPath(pathPos.z);

    float railOffset = u_camera_dist;
    // Subtle rotation of the camera rail around the center path
    vec2 railVec = vec2(cos(t * 0.1), sin(t * 0.1)) * railOffset;

    vec3 ro = pathPos; 
    ro.xy += railVec; // Place camera on the rail

    vec3 ta = vec3(0.0, 0.0, t + 8.0); 
    ta.xy += getPath(ta.z) + railVec * 0.6; // Look slightly towards path but keep distance

    // Camera Basis
    vec3 f = normalize(ta - ro);
    vec3 r = normalize(cross(vec3(0, 1, 0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f * u_fov + uv.x * r + uv.y * u);

    // --- Raymarching ---
    float d = 0.0;
    float t_dist = 0.0;
    vec3 p;
    float glow = 0.0;

    for(int i = 0; i < MAX_STEPS; i++) {
        p = ro + rd * t_dist;
        d = map(p);

        // Volumetric glow accumulation
        glow += 0.01 / (0.01 + abs(d));

        if(abs(d) < SURF_DIST || t_dist > MAX_DIST) break;
        t_dist += d * 0.7; // Relaxed step for smoother fractals
    }

    // --- Shading ---
    vec3 col = vec3(0.0);

    if(t_dist < MAX_DIST) {
        vec3 n = getNormal(p);
        vec3 lightPos = ro + vec3(0, 5, 0);
        vec3 l = normalize(lightPos - p);

        float diff = clamp(dot(n, l), 0.0, 1.0);
        float amb = 0.5 + 0.5 * n.y;
        float spec = pow(clamp(dot(reflect(-l, n), -rd), 0.0, 1.0), 32.0);

        // Dynamic Palette based on Z depth and time
        vec3 palette = 0.5 + 0.5 * cos(vec3(0, 2, 4) + p.z * 0.2 + iTime);

        col = palette * (diff + amb) + spec;

        // Fresnel
        float fres = pow(1.0 - max(0.0, dot(n, -rd)), 5.0);
        col += fres * palette;
    }

    // Fog and Atmospheric Glow
    float fog = 1.0 - exp(-0.02 * t_dist);
    vec3 skyCol = vec3(0.02, 0.01, 0.05) + 0.1 * vec3(sin(iTime), cos(iTime), 1.0);
    col = mix(col, skyCol, fog);

    // Add procedural glow (the "whispers")
    col += glow * 0.02 * vec3(0.4, 0.7, 1.0);

    // Post Processing
    col = pow(col, vec3(0.85)); // Gamma Correction-ish
    col *= 1.0 - dot(uv, uv) * 0.4; // Vignette

    fragColor = vec4(col, 1.0);
}
